import React from 'react';

const WineList = () => {


  return (
    <div>
      <h1>Wine List</h1>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Name</th>
            <th>Type</th>
            <th>Alcohol</th>
            <th>Acidity</th>
            <th>Quality</th>
          </tr>
        </thead>
        <tbody>
          {wineData.map((wine) => (
            <tr key={wine.id}>
              <td>{wine.id}</td>
              <td>{wine.name}</td>
              <td>{wine.type}</td>
              <td>{wine.alcohol}</td>
              <td>{wine.acidity}</td>
              <td>{wine.quality}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default WineList;
